INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, 'test', '', 'filtered_html'),
('node', 'page', 0, 2, 2, 'und', 0, 'test page', '', 'filtered_html'),
('node', 'dinosaurs', 0, 3, 3, 'und', 0, 'Pachyrhinosaurus is a close relative of the more familiar Triceratops. There are three know species of Pachyrhinosaurus. The type specimen Pachyrhinosaurus canadensis was discovered in Alberta, Canada in 1946 by Charles Sternberg and named in 1950. Its range included Alaska and Alberta. Pachyrhinosaurus lakustai was discovered in 1972 by science teacher Al Lakusta. In 2012 a partial skull was found in Alaska and was named Pachyrhinosaurus perotorum after Ross Perot who was a contributor to the museum that sponsored the dig. The big bony boss on the nose distinguishes Pachyrhinosaurus from most ceratopsians.', '', 'filtered_html'),
('node', 'page', 0, 4, 4, 'und', 0, 'Dinosaurs List', '', 'filtered_html'),
('node', 'page', 0, 5, 5, 'und', 0, 'Accessories Sets List', '', 'filtered_html'),
('node', 'page', 0, 6, 6, 'und', 0, 'Fantasy Sets list', '', 'filtered_html'),
('node', 'page', 0, 7, 7, 'und', 0, 'Farm Animals list', '', 'filtered_html'),
('node', 'page', 0, 8, 8, 'und', 0, 'North American Animals List', '', 'filtered_html'),
('node', 'page', 0, 9, 9, 'und', 0, 'Wild Animals List', '', 'filtered_html'),
('node', 'page', 0, 10, 10, 'und', 0, 'Marine Animals List', '', 'filtered_html'),
('node', 'farm_animals', 0, 12, 12, 'und', 0, 'Cows have four stomachs. Each stomach plays a different role in the cow''s digestion. Cows can produce about 30 liters of milk a day. Some cows are bred for milk while others are bred for their beef.', '', 'filtered_html'),
('node', 'north_american_animals', 0, 13, 13, 'und', 0, 'The "white-tail" refers to the underside of the deer''s tail, which it displays and wags when it senses danger. They spend the summer grazing in the meadows and move into the forests during the winter to protect themselves from the elements. Their coats fade from reddish brown in the summer to grayish brown in the winter. They use their speed to outrun their predators, they can sprint up to 30 mph, and they can leap as high as 10 ft and as far as 30 ft in a single bound. They give birth to 1-3 young at a time, usually in May and June.', '', 'filtered_html'),
('node', 'wild_animals', 0, 14, 14, 'und', 0, 'Consequat decet interdico iusto luptatum nunc occuro veniam. At consequat persto premo utinam. Dolus esca mos vero. Abdo cogo eros imputo secundum. Abico hendrerit hos uxor valetudo. Haero mos si. Eu gemino iaceo jumentum magna nutus oppeto sagaciter vulpes. Autem gemino illum neque quadrum.\r\n\r\nIaceo usitas vero vindico volutpat. Accumsan augue dolor elit facilisis feugiat genitus lucidus nostrud volutpat. Abigo antehabeo exputo humo jus quidem usitas. Antehabeo aptent pecus validus. Augue dolore ex ibidem natu quibus. At iaceo iriure magna. Cogo eum hendrerit illum natu nulla tum zelus. Jus minim nobis. Brevitas huic nisl pala pecus roto suscipit. Acsi brevitas eros nibh nobis premo sit sudo vel.\r\n\r\nCamur dolus esse eu mauris nulla rusticus scisco sudo. Antehabeo bene cui ea euismod ludus magna olim secundum vulputate.\r\n\r\nCausa consequat esse illum jugis modo occuro. Augue nibh ratis. Imputo plaga verto. Aptent quia saluto turpis valetudo vereor. Abdo abico jus ludus. Secundum valetudo vicis. Abbas commodo gravis magna pala rusticus verto.\r\n\r\nCausa cogo erat eum huic laoreet scisco secundum typicus. Esca ex gravis illum nisl pertineo sed. Consectetuer eligo esse ludus nisl scisco. Amet comis consequat nunc obruo paratus patria suscipit ymo. Ad ludus suscipit torqueo. Aliquip neque similis. Erat lucidus nobis pneum torqueo turpis vindico. Antehabeo augue duis eros inhibeo loquor sagaciter.\r\n\r\nIn odio pagus praemitto sed. Amet erat haero illum ludus paulatim quadrum sagaciter tincidunt turpis.\r\n\r\n', '', 'plain_text'),
('node', 'marine_animals', 0, 16, 16, 'und', 0, 'Humpback whales are known for their magical songs that travel great distances through the oceans. These songs are made up of moans, howls, cries and other noises and often go on for many hours. They migrate annually from near the poles to warmer waters near the equator. They appear to be very affectionate with their young, swimming close together and touching fins. These whales are very powerful swimmers, using their tail fins, called flukes, to propel themselves through and sometimes completely out of the water.', '', 'filtered_html'),
('node', 'fantasy_sets', 0, 17, 17, 'und', 0, 'Antuu, the Captain of the Guard of Tempest Hall stands inside the gate shouting commands to the last nineteen of his men. He had spent the last day and night watching as over four hundred of his soldiers fall to their deaths trying to protect Xiun against one mighty warrior, Razhan Mol. Knowing the powers of Xiun the Crystal Mage, Antuu looks up at his mistress and understands that she will do whatever is necessary to try to protect Tempest Hall. He looks at her and without comprehending the meaning of her face; he turns his sights back to the few remaining men who are all changing to stone before his very eyes. Even with the strength of the stone pillars that now rest against the door, Antuu can see the gate begin to crack and give way. Antuu draws his sword for the last stand against the mighty warrior, Razhan Mol, and looks up again towards her. This time he understands the meaning of her look; he screams and drops his sword as she turns away. Antuu closes his eyes and sees only black. A great crashing sound awakens him. He opens his eyes and he casts a glance in every direction and at last looks down a great distance to see the warrior who has now broken through the gate. At last it dawns on him, he is no longer a lone man fighting to protect Xiun the Crystal Mage, she has transformed him. Antuu the Hydra is born.', '', 'filtered_html'),
('node', 'accessories', 0, 18, 18, 'und', 0, 'Bright and early or late at night- it''s not just the farmers who are working around the clock but all their animals too. With chickens laying eggs, and cows giving milk the whole farm is busy. Take a birds eye view of what''s going on inside with a roof that opens for easy access and a ladder to help the farmers reach the porch. Make sure all the animals are fed and ready for the day ahead with bales of hay and troughs for water and food. Storing those bales of hay inside is no problem with a working pulley hook. Who is the busiest in the barn?', '', 'filtered_html');
