(3, 'node', ' pachyrhinosaurus thicknosedlizard late cretaceous 7369 million years ago ornithischia ceratopsia herbivore planteater 26ft 8m long 4 tons 36 metric tons al lakusta 1972 north america pachyrhinosaurus is a close relative of the more familiar triceratops there are three know species of pachyrhinosaurus the type specimen pachyrhinosaurus canadensis was discovered in alberta canada in 1946 by charles sternberg and named in 1950 its range included alaska and alberta pachyrhinosaurus lakustai was discovered in 1972 by science teacher al lakusta in 2012 a partial skull was found in alaska and was named pachyrhinosaurus perotorum after ross perot who was a contributor to the museum that sponsored the dig the big bony boss on the nose distinguishes pachyrhinosaurus from most ceratopsians an6001 3 years and up 3 x 4 20 accessories terra by battat animals sold separately  ', 0),
