(11, 'node', ' where to buy ', 0),
(12, 'node', ' holstein cow thicknosedlizard late cretaceous 7369 million years ago ornithischia ceratopsia herbivore planteater 26ft 8m long 4 tons 36 metric tons al lakusta 1972 north america cows have four stomachs each stomach plays a different role in the cow s digestion cows can produce about 30 liters of milk a day some cows are bred for milk while others are bred for their beef an6001 3 years and up 3 x 4 20 accessories terra by battat animals sold separately  ', 0),
(13, 'node', ' whitetail deer doe  thicknosedlizard late cretaceous 7369 million years ago ornithischia ceratopsia herbivore planteater 26ft 8m long 4 tons 36 metric tons al lakusta 1972 north america the whitetail refers to the underside of the deer s tail which it displays and wags when it senses danger they spend the summer grazing in the meadows and move into the forests during the winter to protect themselves from the elements their coats fade from reddish brown in the summer to grayish brown in the winter they use their speed to outrun their predators they can sprint up to 30 mph and they can leap as high as 10 ft and as far as 30 ft in a single bound they give birth to 13 young at a time usually in may and june an6001 3 years and up 3 x 4 20 accessories terra by battat animals sold separately  ', 0),
(14, 'node', ' black rhinoceros thicknosedlizard late cretaceous 7369 million years ago ornithischia ceratopsia herbivore planteater 26ft 8m long 4 tons 36 metric tons al lakusta 1972 north america consequat decet interdico iusto luptatum nunc occuro veniam at consequat persto premo utinam dolus esca mos vero abdo cogo eros imputo secundum abico hendrerit hos uxor valetudo haero mos si eu gemino iaceo jumentum magna nutus oppeto sagaciter vulpes autem gemino illum neque quadrum iaceo usitas vero vindico volutpat accumsan augue dolor elit facilisis feugiat genitus lucidus nostrud volutpat abigo antehabeo exputo humo jus quidem usitas antehabeo aptent pecus validus augue dolore ex ibidem natu quibus at iaceo iriure magna cogo eum hendrerit illum natu nulla tum zelus jus minim nobis brevitas huic nisl pala pecus roto suscipit acsi brevitas eros nibh nobis premo sit sudo vel camur dolus esse eu mauris nulla rusticus scisco sudo antehabeo bene cui ea euismod ludus magna olim secundum vulputate causa consequat esse illum jugis modo occuro augue nibh ratis imputo plaga verto aptent quia saluto turpis valetudo vereor abdo abico jus ludus secundum valetudo vicis abbas commodo gravis magna pala rusticus verto causa cogo erat eum huic laoreet scisco secundum typicus esca ex gravis illum nisl pertineo sed consectetuer eligo esse ludus nisl scisco amet comis consequat nunc obruo paratus patria suscipit ymo ad ludus suscipit torqueo aliquip neque similis erat lucidus nobis pneum torqueo turpis vindico antehabeo augue duis eros inhibeo loquor sagaciter in odio pagus praemitto sed amet erat haero illum ludus paulatim quadrum sagaciter tincidunt turpis an6001 3 years and up 3 x 4 20 accessories terra by battat animals sold separately  fil4cdftmptxt ', 0),
(16, 'node', ' humpback whale thicknosedlizard late cretaceous 7369 million years ago ornithischia ceratopsia herbivore planteater 26ft 8m long 4 tons 36 metric tons al lakusta 1972 north america humpback whales are known for their magical songs that travel great distances through the oceans these songs are made up of moans howls cries and other noises and often go on for many hours they migrate annually from near the poles to warmer waters near the equator they appear to be very affectionate with their young swimming close together and touching fins these whales are very powerful swimmers using their tail fins called flukes to propel themselves through and sometimes completely out of the water an6001 3 years and up 3 x 4 20 accessories terra by battat animals sold separately  ', 0),
(17, 'node', ' antuu the hydra antuu the captain of the guard of tempest hall stands inside the gate shouting commands to the last nineteen of his men he had spent the last day and night watching as over four hundred of his soldiers fall to their deaths trying to protect xiun against one mighty warrior razhan mol knowing the powers of xiun the crystal mage antuu looks up at his mistress and understands that she will do whatever is necessary to try to protect tempest hall he looks at her and without comprehending the meaning of her face he turns his sights back to the few remaining men who are all changing to stone before his very eyes even with the strength of the stone pillars that now rest against the door antuu can see the gate begin to crack and give way antuu draws his sword for the last stand against the mighty warrior razhan mol and looks up again towards her this time he understands the meaning of her look he screams and drops his sword as she turns away antuu closes his eyes and sees only black a great crashing sound awakens him he opens his eyes and he casts a glance in every direction and at last looks down a great distance to see the warrior who has now broken through the gate at last it dawns on him he is no longer a lone man fighting to protect xiun the crystal mage she has transformed him antuu the hydra is born an6001 3 years and up 3 x 4 20 accessories terra by battat animals sold separately  ', 0),
(18, 'node', ' animal barn bright and early or late at night it s not just the farmers who are working around the clock but all their animals too with chickens laying eggs and cows giving milk the whole farm is busy take a birds eye view of what s going on inside with a roof that opens for easy access and a ladder to help the farmers reach the porch make sure all the animals are fed and ready for the day ahead with bales of hay and troughs for water and food storing those bales of hay inside is no problem with a working pulley hook who is the busiest in the barn an6001 3 years and up 3 x 4 20 accessories terra by battat animals sold separately 1 wooden barn 1 ladder 2 food troughs 4 bales of hay 1 hayloft pulley tray 1 removable loft 10 fences  ', 0);
